//       <a style={linkStyle}>Home</a>
//     </Link>
//     <Link href="/about">
//       <a style={linkStyle}>About</a>
//     </Link>
//   </div>
// );

const Navbar = () => {
  <div style={body}>
    <div style={NavbarMenus}>
      <div>
        <Link>
          <a style={logo}>Jobaho</a>
        </Link>
        <Link>
          <a style={NavbarMenu}>Home</a>
        </Link>
        <Link>
          <a style={NavbarMenu}>About Us</a>
        </Link>
        <Link>
          <a style={NavbarMenuJob}>Find a Job</a>
        </Link>
      </div>
    </div>
  </div>;
};

export default Navbar;
